import api from '@/utils/requests.js'
import qs from 'qs'
// 发送订单商品信息
function sendOrder(orderData){
    return api.post('http://localhost:8000/user/order_commodity', qs.stringify({order_id:orderData.order_id,u_id:orderData.u_id,commodity_id:orderData.commodity_id,title:orderData.title,price:orderData.price,brand_id:orderData.brand_id,category_id:orderData.category_id,  pictures:orderData.pictures,quantity:orderData.quantity}))}
export default sendOrder
